import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Nav from "react-bootstrap/Nav";
import HomeScreen from "./screens/HomeScreen";
import RoomsScreen from "./screens/RoomScreen";
import PhotoGalleryScreen from "./screens/PhotoGalleryScreen";
import LocationScreen from "./screens/LocationScreen";
import NearAroundScreen from "./screens/NearAroundScreen";
import ContactScreen from "./screens/ContactScreen";
import NavDropdown from "react-bootstrap/NavDropdown";
import logo from "./assets/svg/black-logo.svg"; // Import the SVG logo
import "./App.scss";

const handleSelect = (eventKey) => alert(`selected ${eventKey}`);

const App = () => {
  return (
    <Router>
      <Nav
        variant="tabs"
        className="custom-nav justify-content-end"
        style={{ justifyContent: "right" }}
      >
        <img src={logo} alt="Logo" className="navbar-logo" /> {/* Add the logo */}
        <NavDropdown title="Guest Options" id="nav-dropdown" onSelect={handleSelect}>
          {/* Rest of the code */}
        </NavDropdown>
        {/* Rest of the code */}
      </Nav>
      {/* Rest of the code */}
    </Router>
  );
};

export default App;
